pragma solidity ^0.8.0;
import "./ownable.sol";
contract EternalHouseFactory is Ownable {

    struct slot{
        string description;
        string imgUrl;
        uint256 id; 
        uint256 sold;
        uint32 frozenUntil;
        uint16 size; // 0 - xs , 1 - s, 2 - m, 3 - l, 4-xl, 5 -ul ..
        uint16 changed;
    }

// allotment for sizes
// [0] = xs, [1] = s, [2] = m, [3] = l, [4] = xl, [5] == xxl, [6] == ultra, [7] == king
    uint16[] sizeAllotment = [160,200,300,200,100,100,10,2];

// num slots already created
// [0] = xs, [1] = s, [2] = m, [3] = l, [4] = xl, [5] == xxl, [6] == ultra, [7] == king
    uint16[] sizeCreated = [0,0,0,0,0,0,0,0];



// fees to mint each slot 
// [0] = xs, [1] = s, [2] = m, [3] = l, [4] = xl, [5] == xxl, [6] == ultra, [7] == king
    uint[] sizeFees = [.03 ether, .05 ether, .08 ether, .11 ether, .17 ether, .20 ether, .25 ether,.30 ether];


    slot[1072] slots;
    uint freezeTime = 365 days;
    event NewSlot(uint id, string description,string imgUrl, uint size);
    event UpdatedSlot(uint id, string description,string imgUrl);
    mapping(uint256 => address) public slotToOwner;
    mapping (address => uint256) ownerSlotCount;

    // require that address is owner of the slot
    modifier onlyOwnerOf(uint256 id) {
    require(msg.sender == slotToOwner[id]);
    _;
  }

    // only owner can withdraw money deposited in the contract
      function withdraw() external onlyOwner returns(bool){
        address payable _owner = payable(msg.sender);
        _owner.transfer(address(this).balance);
        return true;
    }


    // require that address is owner of the slot
    modifier canMint(uint16 _size) {
            require(sizeCreated[_size] < sizeAllotment[_size], "All slots for that this size been minted");
    _;
  }
    /// @return an id for the slot
    function _createID(uint16 _size) internal view returns(uint16){
        if(_size == 0){ // xs
            return sizeCreated[0];
        } 
        uint16 _id = 0;
        for(uint16 i = 0; i < _size; i++){
            _id = _id + sizeAllotment[i];
        }
        _id = _id + sizeCreated[_size];
        return _id;

    }

    // update freezeTime
    function _updateFreezeTime(uint num) external onlyOwner returns(bool){
        freezeTime = num * 1 days;
        return true;
    }

    function _updateCreationCount(uint16 _size) internal{
        sizeCreated[_size] = sizeCreated[_size] + 1;

    }

    /// call a helper function to help with the minting
    function createSlot(string[] memory _descriptionArr, string[] memory _imgUrlArr, uint16[] memory _sizeArr) public payable {
        require(_enoughEther(_sizeArr) == true,"Fee entered is not fee for the slot");
         for(uint16 i = 0; i < _descriptionArr.length; i++){
             string memory _description = _descriptionArr[i];
             string memory _imgUrl = _imgUrlArr[i];
             uint16 _size = _sizeArr[i];
            _createSlot(_description, _imgUrl, _size);
        }

    }

    /// @return address of slot's owner
    function _enoughEther(uint16[] memory _sizeArr) internal returns(bool){
        uint needed = 0 ether;
        for(uint16 i = 0; i < _sizeArr.length; i++){
            needed = needed + _sizeArr[i];
        }
        return msg.value >= needed;
    }

    /// initializes a slot in the Infinity Collections
    /// @dev check if more slots can minted, 
    /// @param _description - the description of the slot 
    /// @param _imgUrl - the imgURL associated with the slot
    /// @param _size -- the slot's size 
    function _createSlot(string memory _description, string memory _imgUrl, uint16 _size) internal canMint(_size){
        uint16 id = _createID(_size);
        slot memory purchased = slot(_description, _imgUrl,id,1,0, _size,1); // new slot
        slots[id] = purchased;
        slotToOwner[id] = msg.sender; // attach slot to owner
        ownerSlotCount[msg.sender]++; // add slot to the owner count
        _updateCreationCount(_size);
        emit NewSlot(id, _description, _imgUrl, _size);
    }

    /// @return address of slot's owner
    function _getOwner(uint256 id) public view returns(address){
        return slotToOwner[id];
    }

    /// change information associated with a slot
    function changeSlotInfo(uint256 id, string memory _description, string memory _imgUrl) public {
        _changeSlotInfo(id, _description, _imgUrl);
    }

    /// @dev -- makes sure that person hasn't edited slot more than twice
    /// @param id -- associated with slot
    /// @param _description -- slot's description to change to
    /// @param _imgUrl -- slot's new imgUrl
    function _changeSlotInfo(uint256 id, string memory _description, string memory _imgUrl) internal onlyOwnerOf(id){
        slot storage mySlot = slots[id]; 
        require(mySlot.changed < 2, "Reached maximum number of edits");
        mySlot.description = _description;
        mySlot.imgUrl = _imgUrl;
        mySlot.changed++;
        emit UpdatedSlot(id, _description, _imgUrl);
    }

    /// @dev -- restore slot after sold then trigger freeze if sold more than 5 times
    /// @param _mySlot -- slot to restore

    function _restoreSlotChanged(slot storage _mySlot) internal{ // come back and fix name
        _mySlot.changed = 1;
        _mySlot.sold += 1;
        if(_mySlot.sold > 5){
            _triggerFreeze(_mySlot);
        }
    }


    // @return boolean -- is the slot able to be sold ?
     function _isReady(slot storage _slot) internal view returns (bool) {
      return (_slot.frozenUntil <= block.timestamp);
  }

    // freeze the slot for 1 year
    function _triggerFreeze(slot storage _slot) internal {
    _slot.frozenUntil  = uint32(block.timestamp + freezeTime);
  }



}

